void processGoods() {
    info << "all_goods_info[map_index].size():" << all_goods_info[map_index].size() << endl;
    for(int i = 0; i < all_goods_info[map_index].size(); i++) {
        int x = all_goods_info[map_index][i].x, y = all_goods_info[map_index][i].y, val = all_goods_info[map_index][i].value;
        int gen_time = all_goods_info[map_index][i].generate_time, vanish_time = all_goods_info[map_index][i].vanish_time;

        if(val <= 0) continue;

        value_radio[val / 10] ++;
        all_goods_cnt ++;

        all_goods_val += val;
        total_value += val;

        int dis = 0x3f3f3f3f;
        int nearest_berth = -1;

        for(int j = 0; j < berth_num; j++) {
            int dis_temp = robot_to_berth_hCost[j][x][y] >= 10000 ? abs(x - berth[j]->x) + abs(y - berth[j]->y) + 100 : robot_to_berth_hCost[j][x][y];
            if (dis_temp < dis) {
                dis = dis_temp;
                nearest_berth = j;
            }
        }
        belong_berth_num[nearest_berth] ++;
        info << x << " " << y << " " << val << " " << vanish_time << " " << nearest_berth << " " << gen_time << endl;
        goods_vanish_time[x][y] = vanish_time - 5;
        goods_infos.push_back({x, y, val, vanish_time - 5, false, nearest_berth, gen_time});
    }
}

