void update(int step) {
    for(int i = 0; i < berth_num; i++) {
        if(berth[i]->is_locked) {
            bool flag = 0;
            for(int  j = 0; j < boat_num; j++) {
                if(boat[j]->mbBerthId == i) {
                    flag = 1;
                    break;
                }
            }
            if(!flag) {
                berth[i]->is_locked = false;
            }
        }
    }


    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            if (gds[i][j] > 0 && goods_vanish_time[i][j] <= step && goods_vanish_time[i][j] > 900) {
                all_goods_val -= gds[i][j];
                gds[i][j] = 0;
            }
        }
    }
    goods_infos.erase(std::remove_if(goods_infos.begin(), goods_infos.end(), [&](const GoodsInfo &o){ return o.vanish_time - 5 <= step; }), goods_infos.end());

    all_init_finished = true;
    robot_all_init_finished = true;
    berth_all_init_finished = true;
    deliver_all_init_finished = true;
    for(int i = 0; i < berth_num; i++) {
        if(robot_init_finished[i] == false) {
            robot_all_init_finished = false;
            all_init_finished = false;
        }
        if(berth_init_finished[i] == false) {
            berth_all_init_finished = false;
            all_init_finished = false;
        }
    }
    for(int i = 0; i < delivery_point.size(); i++) {
        if(deliver_init_finished[i] == false) {
            deliver_all_init_finished = false;
            all_init_finished = false;
        }
    }
    if(robot_all_init_finished) {
        // if(goods_infos.empty()) processGoods();
        info << "所有机器人初始化完成在" << step << "时刻" << endl;
    }
    if(berth_all_init_finished) {
        info << "所有泊位初始化完成在" << step << "时刻" << endl;
    }
    if(deliver_all_init_finished) {
        info << "所有交货点初始化完成在" << step << "时刻" << endl;
    }
    if(all_init_finished) {
        info << "所有初始化完成在" << step << "时刻" << endl;
    }
}

